import React,{Component} from "react";
import Card from "react-bootstrap/Card";
// import Button from "react-bootstrap/Button";
import ListGroup from "react-bootstrap/ListGroup";
import AddPokemonButton from "../AddPokemonButton/AddPokemonButton";
import DeletePokemonButton from "../DeletePokemonButton/DeletePokemonButton";

class PokemonProfile extends Component {

    render() {
        return(
            <Card>
                <Card.Body>
                    <Card.Title>Pokemon</Card.Title>
                    <Card.Text>
                        <Card style={{ width: '18rem' }}>
                        </Card>
                    </Card.Text>
                    <AddPokemonButton></AddPokemonButton>
                    <DeletePokemonButton></DeletePokemonButton>
                </Card.Body>
            </Card>
        )
    }
}

export default PokemonProfile;
